char* myinputptr="int main(int argc, char* argv[]);";
char* myinputlim;
int my_yyinput(char* buf,int max_size)
{
	int n = min(max_size,*(int*)&myinputlim - *(int*)&myinputptr);
	if(n > 0)
	{
		memcpy(buf,myinputptr,n);
		myinputptr += n;
	}
	return n;
}
